021-05-11 08:32:40','[text name-and-surname placeholder \"Imię i nazwisko\"]\r\n[email* email placeholder \"Adres e-mail\"]\r\n[tel* phone placeholder \"Telefon\"]\r\n[textarea* message placeholder \"Twoja wiadomość\"]\r\n[acceptance acceptance-580] Wyrażam zgodę na przetwarzanie moich danych osobowych przez ... [/acceptance]\r\n[submit \"WYŚLIJ\"]\n1\n[_site_title] - \"Kontakt za pomocą formularza kontaktowego\"\n[_site_title] <wordpress@daniel.localhost>\n[_site_admin_email]\nNadawca: [name-and-surname] <[email]>\r\nTelefon: [phone]\r\n\r\nTreść wiadomości:\r\n[message]\r\n\r\n-- \r\nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\nReply-To: [email]\n\n\n\n\n[_site_title] - \"[your-subject]\"\n[_site_title] <wordpress@daniel.localhost>\n[your-email]\nTreść wiadomości:\r\n[your-message]\r\n\r\n-- \r\nTa wiadomość została wysłana przez formularz kontaktowy na stronie [_site_title] ([_site_url]).\nReply-To: [_site_admin_email]\n\n\n\nTwoja wiadomość została wysłana. Dziękujemy!\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nPrzynajmniej jedno pole jest błędnie wypełnione. Sprawdź wpisaną treść i spróbuj ponownie.\nWystąpił problem z wysłaniem twojej wiadomości. Spróbuj ponownie później.\nMusisz wyrazić zgodę na powyższe zapisy, aby móc wysłać formularz.\nWymagane jest wypełnienie tego pola.\nZawartość tego pola jest zbyt długa.\nZawartość tego pola jest zbyt krótka.\nPodczas wgrywania pliku wystąpił nieznany błąd.\nNie możesz wgrywać plików tego typu.\nTen plik jest zbyt duży.\nWystąpił błąd podczas wgrywania pliku.\nFormat daty jest niepoprawny.\nData jest wcześniejsza, niż pierwsza dozwolona.\nData jest późniejsza, niż ostatnia dozwolona.\nFormat liczby jest niepoprawny.\nTa liczba jest mniejsza, niż minimalna dopuszczana.\nTa liczba jest większa, niż maksymalna dopuszczalna.\nOdpowiedź w quizie jest nieprawidłowa.\nWprowadzony adres e-mail jest nieprawidłowy.\nWprowadzony adres URL jest nieprawidłowy.\nWprowadzony numer telefonu jest nieprawidłowy.','Strona kontakt','','publish','closed','closed','','strona-kontakt','','','2021-05-11 10:48:53','2021-05-11 08:48:53','',0,'http://daniel.localhost/?post_type=wpcf7_contact_form&#038;p=45',0,'wpcf7_contact_form','',0),(46,1,'2021-05-11 13:35:32','2021-05-11 11:35:32','','About us','','publish','closed','closed','','about-us','','','2021-05-11 13:49:43','2021-05-11 11:49:43','',0,'http://daniel.localhost/?post_type=cfs&#038;p=46',0,'cfs','',0),(47,1,'2021-05-11 13:44:57','2021-05-11 11:44:57','','cert','','inherit','open','closed','','cert','','','2021-05-11 13:44:57','2021-05-11 11:44:57','',11,'http://daniel.localhost/wp-content/uploads/2021/05/cert.jpg',0,'attachment','image/jpeg',0);
